// AcademicsPopup.js

import React from 'react';

function AcademicsPopup() {
  return (
    <div className="academics-popup">
      <div className="popup-section">
        <div className="popup-main-link">Programs</div>
        <Link className="popup-sub-link" to='/undergraduate'>Undergraduate</Link>
        <Link className="popup-sub-link" to='/postgraduate'>Postgraduate</Link>
      </div>
      <div className="popup-section">
        <Link className="popup-main-link" to='/academic-calendar'>Academic Calendar</Link>
        <Link className="popup-main-link" to='/director-continuing-education'>Directorate of Continuing Education</Link>
        <Link className="popup-main-link" to='/object-based-learning'>Object Based Learning</Link>
      </div>
    </div>
  );
}

export default AcademicsPopup;
